        public static int FindMaxConsecutiveOnes(int[] nums)
        {
            int longestSequence = 0;
            int left = 0;
            int right = 0;
            int numZeroes = 0;

            // while our window is in bounds
            while (right < nums.Length)
            {

                // add the right most element into our window
                if (nums[right] == 0)
                {
                    numZeroes++;
                }

                // if our window is invalid, contract our window
                while (numZeroes == 2)
                {
                    if (nums[left] == 0)
                    {
                        numZeroes--;
                    }
                    left++;
                }

                // update our longest sequence answer
                longestSequence = Math.Max(longestSequence, right - left + 1);

                // expand our window
                right++;
            }
            return longestSequence;
        }
        public static int FindMaxConsecutiveOnes_2(int[] nums)
        {
            int longestSequence = 0;
            for (int left = 0; left < nums.Length; left++)
            {
                int numZeroes = 0;

                // check every consecutive sequence
                for (int right = left; right < nums.Length; right++)
                {
                    // count how many 0's
                    if (nums[right] == 0)
                    {
                        numZeroes += 1;
                    }
                    // # update answer if it's valid
                    if (numZeroes <= 1)
                    {
                        longestSequence = Math.Max(longestSequence, right - left + 1);
                    }
                }
            }
            return longestSequence;
        }
        public static int FindMaxConsecutiveOnes_1(int[] nums)
        {
            if (nums.Length == 1) return 1;
            int ConsecutiveOnes = 0, maxConsecutiveOnes = 0, atMostZero = 0;
            for (int i = 0; i < nums.Length; i++)
            {
                for (int j = i; j < nums.Length; j++)
                {
                    if (nums[j] == 0) atMostZero++;
                    if (atMostZero <= 1) ConsecutiveOnes++;
                    if (atMostZero == 2) break;
                }
                if (maxConsecutiveOnes < ConsecutiveOnes)
                    maxConsecutiveOnes = ConsecutiveOnes;
                ConsecutiveOnes = 0;
            }
            return maxConsecutiveOnes;
        }
    }
